pragma solidity = 0.8.7;

contract Trust {
    address public kid;
    uint public maturity;

    constructor(address _kid, uint timeToMaturity) payable {
        kid = _kid;
        maturity = block.timestamp +  timeToMaturity;
    }

    function withdraw() external {
        require(block.timestamp >= maturity, 'Grow up');
         
    }
}

